import { View, Text } from 'react-native'

const CategorieScreen = () => {
    return (
      <View>
        <Text>Accueil categorie</Text>
        <StatusBar
          barStyle="dark-content"
          hidden={false}
          backgroundColor="#00BCD4"
          translucent={true}
        />
      </View>
    );
}

export default categorie
